// main.js
const { app, BrowserWindow, ipcMain, dialog, shell } = require("electron");
const path = require("path");
const fs = require("fs");
const url = require("url"); // درست شد ✅

let mainWindow;
// const dataFile = path.join(__dirname, "data.json");
// const passwordFile = path.join(__dirname, "password.json");

const dataFile = path.join(app.getPath("userData"), "data.json");
const passwordFile = path.join(app.getPath("userData"), "password.json");

// مسیر آیکون (dev یا نصب‌شده)
// const appIcon = path.join(__dirname, "assets/icon.ico");
const appIcon =
  process.platform === "darwin"
    ? path.join(__dirname, "assets/icon.icns")
    : path.join(__dirname, "assets/icon.ico");

function createWindow() {
  // اطمینان از وجود فایل داده قبل از ساخت پنجره
  if (!fs.existsSync(dataFile)) {
    fs.writeFileSync(dataFile, "[]", "utf8");
  }

  mainWindow = new BrowserWindow({
    width: 1250,
    height: 900,
    webPreferences: {
      nodeIntegration: true,
      contextIsolation: false,
    },
    icon: appIcon, // لوگوی اپ
  });

  // mainWindow.webContents.openDevTools();
  // Start from login page (consistent with your flow)
  mainWindow.loadFile("login.html");
}

// Data: backup with user-selected path
ipcMain.handle("backup-data", async () => {
  try {
    if (!fs.existsSync(dataFile)) return null;

    const { filePath } = await dialog.showSaveDialog({
      title: "ذخیره بکاپ",
      defaultPath: path.join(
        app.getPath("documents"),
        `backup-${Date.now()}.json`
      ),
      filters: [{ name: "JSON Files", extensions: ["json"] }],
    });

    if (!filePath) {
      return { ok: false, cancelled: true };
    }

    fs.copyFileSync(dataFile, filePath);

    return { ok: true, filePath };
  } catch (err) {
    console.error("Backup error:", err);
    return {
      ok: false,
      cancelled: false,
      message: err?.message || "Unknown error",
    };
  }
});

// ✅ هندلر ریست بکاپ با بررسی اعتبار فایل
ipcMain.handle("reset-backup", async () => {
  try {
    const { filePaths, canceled } = await dialog.showOpenDialog({
      title: "انتخاب فایل بکاپ برای جایگزینی",
      filters: [{ name: "JSON Files", extensions: ["json"] }],
      properties: ["openFile"],
    });

    if (canceled || !filePaths?.[0]) {
      return { ok: false, cancelled: true };
    }

    const backupPath = filePaths[0];
    const raw = fs.readFileSync(backupPath, "utf8");
    const parsed = JSON.parse(raw);

    if (!Array.isArray(parsed)) {
      throw new Error("فایل بکاپ معتبر نیست. باید آرایه‌ای از داده‌ها باشد.");
    }

    fs.writeFileSync(dataFile, JSON.stringify(parsed, null, 2), "utf8");

    return { ok: true };
  } catch (err) {
    console.error("Reset backup error:", err);
    return {
      ok: false,
      cancelled: false,
      message: err?.message || "Unknown error",
    };
  }
});

ipcMain.handle("clear-all-data", async () => {
  try {
    fs.writeFileSync(dataFile, "[]", "utf8");
    return { ok: true };
  } catch (err) {
    console.error("Clear all data error:", err);
    return {
      ok: false,
      message: err?.message || "Unknown error",
    };
  }
});

app.whenReady().then(createWindow);

app.on("window-all-closed", () => {
  if (process.platform !== "darwin") app.quit();
});

app.on("activate", () => {
  if (BrowserWindow.getAllWindows().length === 0) createWindow();
});

// Data: load
ipcMain.handle("load-data", async () => {
  try {
    if (!fs.existsSync(dataFile)) {
      fs.writeFileSync(dataFile, "[]", "utf8");
    }

    const raw = fs.readFileSync(dataFile, "utf8");
    return JSON.parse(raw);
  } catch (err) {
    console.error("Load error:", err);
    return [];
  }
});

// Data: save
ipcMain.handle("save-data", async (_, newData) => {
  try {
    fs.writeFileSync(dataFile, JSON.stringify(newData, null, 2), "utf8");
    return true;
  } catch (err) {
    console.error("Save error:", err);
    return false;
  }
});

// Password: check
ipcMain.handle("check-password", async (_, input) => {
  try {
    if (!fs.existsSync(passwordFile)) {
      fs.writeFileSync(
        passwordFile,
        JSON.stringify({ password: "1234" }),
        "utf8"
      );
    }
    const { password } = JSON.parse(fs.readFileSync(passwordFile, "utf8"));
    return input === password;
  } catch (err) {
    console.error("Password check error:", err);
    return false;
  }
});

// Password: change
ipcMain.handle("change-password", async (_, newPass) => {
  try {
    fs.writeFileSync(
      passwordFile,
      JSON.stringify({ password: newPass }),
      "utf8"
    );
    return true;
  } catch (err) {
    console.error("Change password error:", err);
    return false;
  }
});

